import Form from "./Form.js";
import {useState} from "react";

function Contacts(){
  const [contacts,setContact] = useState([]);


   return(
     <div>
     <Form
     contacts={contacts}
     addContact={setContact}
     />
     </div>
   )
}
export default Contacts;
